import React from 'react';
import '../../App.css';
import NavBar from '../Navbar'
import Artists from '../Artists';

function Playlist() {
  return (
    <>
      <NavBar/>
      <Artists />
      <h1 className='playlist'>CREATE THE PLAYLIST HERE!</h1>;
    </>
  );
}

export default Playlist;
